import React from "react";
import "../components/Footer.css";
import Logo from "../images/logo.svg";

const Footer = () => {
  return (
    <div className="containerfooter">
      <img src={Logo} alt="logo" />
      <ul>
        <li>
          <a href="#">Carrers</a>
        </li>

        <li>
          <a href="#">Event</a>
        </li>

        <li>
          <a href="#">Product</a>
        </li>

        <li>
          <a href="#">Support</a>
        </li>
      </ul>

      <div className="sosmedtrademrk"></div>
    </div>
  );
};

export default Footer;
